//d3mbaugvr53zg5.cloudfront.net/media/elearning/topic/22_-_Wibbitz_-_Contact_and_footer.jpg","description":"In this video, we are going to learn how to structure the contact section and footer section of the wibbitz website.","order_id":22,"duration":578.3,"status":"completed","lesson_name":"Website Structuring","skill_name":"Cascading Style Sheets","practice_data":{},"playlist":{"auto":{"quality":"auto","playlist":"https://player.vimeo.com/external/674957302.m3u8?s=f96d5db06fd82e64b57ca7d34d501f5f6b2b4822"}}}]},{"id":"aa960bff-5b5f-4f2d-9dcd-5cbcf4bb9a98","skill":"f32658b9-49eb-4874-9ece-9a24c81bf6e1","name":"Grid Layout","image":"https://d3mbaugvr53zg5.cloudfront.net/media/elearning/lesson/Grid_layout.png","description":"CSS Grid is a powerful tool that allows for two-dimensional layouts to be created on the web which means it can handle both rows and columns, unlike flexbox which holds as a one-dimensional system. In this lesson, you will learn more about grid elements and it\'s element children\'s (grid items).","order_id":18,"duration":1889.097,"topics":7,"status":"completed","skill_name":"Cascading Style Sheets","current_topic":"dc69de9a-85d2-4bb9-9905-388c36d9d756","topicList":[{"id":"dc69de9a-85d2-4bb9-9905-388c36d9d756","lesson":"aa960bff-5b5f-4f2d-9dcd-5cbcf4bb9a98","name":"Introduction","image":"https://d3mbaugvr53zg5.cloudfront.net/media/elearning/topic/01_-_Introduction_T3SSrOS.jpg","description":"The basic difference between CSS Grid Layout and CSS Flexbox Layout is that flexbox was designed for layout in one dimension - either a row or a column. Grid was designed for two-dimensional layout - rows, and columns at the same time.","order_id":1,"duration":231.866,"status":"completed","lesson_name":"Grid Layout","skill_name":"Cascading Style Sheets","practice_data":{},"playlist":{"auto":{"quality":"auto","playlist":"https://player.vimeo.com/external/674959932.m3u8?s=f37cff61d3cb9d8c414e700e58a0c16a63e7b08a"}}},{"id":"ddfd3b09-8e0d-4498-8b16-adefe9025c67","lesson":"aa960bff-5b5f-4f2d-9dcd-5cbcf4bb9a98","name":"Arranging rows and columns","image":"https://d3mbaugvr53zg5.cloudfront.net/media/elearning/topic/02_-_Arranging_rows_and_columns.jpg","description":"We can arrange rows and columns by using the properties \u2018grid-template-columns\u2019 and \u2018grid-template-rows\u2019 after displaying the element as grid by \u2018display\u2019 property.","order_id":2,"duration":569.2,"status":"completed","lesson_name":"Grid Layout","skill_name":"Cascading Style Sheets","practice_data":{},"playlist":{"auto":{"quality":"auto","playlist":"https://player.vimeo.com/external/674960952.m3u8?s=a1d400892ee36d7aa098cdacd080b21c6c901a18"}}},{"id":"7e9b4627-f7b8-4ddb-bf20-91dcacc9f2ce","lesson":"aa960bff-5b5f-4f2d-9dcd-5cbcf4bb9a98","name":"Grid column","image":"https://d3mbaugvr53zg5.cloudfront.net/media/elearning/topic/03_-_Grid_column.jpg","description":"The grid-column property specifies a grid item\'s size and location in a grid layout, and is a shorthand property for the following properties: \u2018grid-column-start\u2019 and \u2018grid-column-end\u2019.","order_id":3,"duration":252.333,"status":"completed","lesson_name":"Grid Layout","skill_name":"Cascading Style Sheets","practice_data":{},"playlist":{"auto":{"quality":"auto","playlist":"https://player.vimeo.com/external/674962533.m3u8?s=9f20258cb3194eef8ebdcab92ba6138921fa6266"}}},{"id":"98e8f93d-0a9d-4818-84fb-a19cdb08dd2c","lesson":"aa960bff-5b5f-4f2d-9dcd-5cbcf4bb9a98","name":"Grid auto rows and grid template rows","image":"https://d3mbaugvr53zg5.cloudfront.net/media/elearning/topic/04_-_Grid_auto_rows_and_grid_template_rows.jpg","description":"The grid-auto-rows defines the size of grid rows that were created implicitly: it means that grid-auto-rows targets the rows that were not defined with grid-template-rows or grid-template-areas. The grid-template-rows property in CSS is used to set the number of rows and height of the rows in a grid. The values of grid-template-rows are space-separated, where each value represents the height of the row.","order_id":4,"duration":242.766,"status":"completed","lesson_name":"Grid Layout","skill_name":"Cascading Style Sheets","practice_data":{},"playlist":{"auto":{"quality":"auto","playlist":"https://player.vimeo.com/external/674963973.m3u8?s=d7bb6dcf2bd11c78ab68c85db3ebe0dca9ab6dbb"}}},{"id":"0dcf3dd6-2d99-4729-8347-cc8678d4c029","lesson":"aa960bff-5b5f-4f2d-9dcd-5cbcf4bb9a98","name":"Grid template areas","image":"https://d3mbaugvr53zg5.cloudfront.net/media/elearning/topic/05_-Grid_template_areas.jpg","description":"The grid-template-areas property specifies areas within the grid layout. You can name grid items by using the grid-area property and then reference to the name in the grid-template-areas property. Each area is defined by apostrophes.","order_id":5,"duration":320.066,"status":"completed","lesson_name":"Grid Layout","skill_name":"Cascading Style Sheets","practice_data":{},"playlist":{"auto":{"quality":"auto","playlist":"https://player.vimeo.com/external/674964985.m3u8?s=9a89ba7c8852623612b2ed6f0655820eb32fe49a"}}},{"id":"a1b91cdf-de44-4dfd-aa50-50c32c02f589","lesson":"aa960bff-5b5f-4f2d-9dcd-5cbcf4bb9a98","name":"Align items in a grid","image":"https://d3mbaugvr53zg5.cloudfront.net/media/elearning/topic/06_-_Align_items_in_a_grid.jpg","description":"We can arrange and align-items in a grid using properties \u2018align-items\u2019 and \u2019 justify-items\u2019 in common. We can also arrange items specifically for a grid using properties \u2018align-self\u2019 and \u2019 justify-self\u2019.","order_id":6,"duration":194.366,"status":"completed","lesson_name":"Grid Layout","skill_name":"Cascading Style Sheets","practice_data":{},"playlist":{"auto":{"quality":"auto","playlist":"https://player.vimeo.com/external/674966285.m3u8?s=c1632399c48b1181686dd64ed07655b56c1319af"}}},{"id":"feaf4708-7c04-457a-8fdf-a2f11d29879e","lesson":"aa960bff-5b5f-4f2d-9dcd-5cbcf4bb9a98","name":"Grid gap","image":"https://d3mbaugvr53zg5.cloudfront.net/media/elearning/topic/07_-_Grid_gap.jpg","description":"The grid-gap property defines the size of the gap between the rows and columns in a grid layout and is a shorthand property for the following properties: \u2018grid-row-gap\u2019 and \u2018grid-column-gap\u2019","order_id":7,"duration":78.5,"status":"completed","lesson_name":"Grid Layout","skill_name":"Cascading Style Sheets","practice_data":{},"playlist":{"auto":{"quality":"auto","playlist":"https://player.vimeo.com/external/674967664.m3u8?s=54a11d8b56ca460cb952ea4dce0d3b40e257061d"}}}]},{"id":"faf2924c-8920-4339-9f9f-4ec0794f4361","skill":"f32658b9-49eb-4874-9ece-9a24c81bf6e1","name":"Space Website","image":"https://d3mbaugvr53zg5.cloudfront.net/media/elearning/lesson/Space_website.png","description":"In the previous lessons, we have learnt the HTML and CSS elements and how to structure the websites. So for now, you will learn to develop a website http://204.48.30.182/talrop_space/.\\r\\n\\r\\nThis website consists of different sections namely spotlight, about section, main section and footer sections. You will learn in-depth, in the upcoming topics to how to develop each structure perfectly.","order_id":19,"duration":5689.83,"topics":7,"status":"completed","skill_name":"Cascading Style Sheets","current_topic":"153af203-97ef-4722-835b-5740b6d9dafa","topicList":[{"id":"153af203-97ef-4722-835b-5740b6d9dafa","lesson":"faf2924c-8920-4339-9f9f-4ec0794f4361","name":"Space Introduction","image":"https://d3mbaugvr53zg5.cloudfront.net/media/elearning/topic/01_-_Space_Introduction.jpg","description":"In the previous lesson, we had learned how to structure a website. In this video session, you will learn how to develop a space website with deep description.","order_id":1,"duration":509.966,"status":"completed","lesson_name":"Space Website","skill_name":"Cascading Style Sheets","practice_data":{},"playlist":{"auto":{"quality":"auto","playlist":"https://player.vimeo.com/external/67497014